import React from "react";
import { Link } from "react-router-dom";


function Header(){
    return (
        <div>
        <header>
<nav>
    <div className="nav-wrapper">
     
      <ul id="nav-mobile" className="right">
        <li><Link to="./AboutMe">About Me</Link></li>
        
    
      </ul>
    </div>
  </nav>
        </header>
        </div>
    )
}

export default Header;
